 @alexandremoraesalmeida33  Flamengo só tem torcida!!!  Até uns anos atrás o flamengo era saco de pancadas em libertadores tomando até gol do barrigudo Cabãnas,  sendo eliminados por América do mexico , emelec do Equador etc ... Flamengo é uma piada , só veio a ganhar mais títulos de expressão na era moderna , enquanto o flamengo tomava saco de pancadas em libertadores e só tinha 1 né o Santos já era tri da libertadores e bi mundial de clubes ...  quem é Flamengo perto da história do Santos ? Santos 3 libertadores , 2 mundiais de clubes , bi campeão da recopa sul-americana , copa hexagonal no Chile,  copa comenbol 1998 , copa do Brasil , 5 copa rio São Paulo , 8  títulos brasileiro teve Pelé , Coutinho,  mengalvio,  Pepe,  teve zito , Neymar , Robinho , Rodrygo Rayo , ... melhor base do mundo e outra vcs amam o Santos né mano ? Todo jogador vocês querem levar pro flamengo vcs são muito cara de pau mesmo ... quiseram a todo custo levar o gabigol , o Bruno Henrique,  o Diego , Thiago Maia,  até o Pará vocês levaram 🤣🤣🤣 toma vergonha na cara mano !!! Até o soteldo vocês queriam levar pro flamengo em 2019 , mano vcs são tão tão trouxas e invejosos que até o sampaoli vocês levaram como técnico ..
 Vai tomar no seu cú arrombado ...  
Cria jogadores da base esquecem o santos mano , não duvido que logo logo vcs vão querer contratar o marcos Leonardo 🤣🤣🤣 vai lá flamengo rema bastante até chegar na grandeza que teve o Santos .
